import React from "react";
import { Generation1 } from "./Generation/Generation1";
import styled from "styled-components";

export const Contact = () => {
  return (

      <>
      <ContStyle>
        <div className="info">
          <h1>Contact Info:</h1>
          <div className="contli">
            <a href="https://www.linkedin.com/in/dcm91/" >https://www.linkedin.com/in/dcm91/</a>
            <a href="https://github.com/DCM91" >https://github.com/DCM91</a>
            <>castromartindaniel91@gmail.com</>
          </div>
      </div>
    </ ContStyle>

    <Generation1 /></>

  );
};

const ContStyle = styled.div`
.info{
  display: flex;
  margin-left: 1.5rem;
  margin-top: 150px;
  margin-bottom: -10rem;
  height: 6rem;
  width: 7rem
}
h1{
  color: #fee4e5;
  font-style: italic;
  font-family: fantasy;
  font-size: x-large;
}
.contli{
  font-size: small;
  font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
  color: #312F30;
  
}
a{
  text-decoration: none;
}
`
